//Polymer string: same letters with opposite capitalization will be destroyed

var entirePolymer = ""

//Part 1
document.writeln('Part 1');

const reactiveList = ['aA', 'Aa', 'bB', 'Bb', 'cC', 'Cc', 'dD', 'Dd', 'Ee',
'eE', 'fF', 'Ff', 'Gg', 'gG', 'hH', 'Hh', 'Ii', 'iI', 'Jj', 'jJ', 'kK', 'Kk',
'Ll', 'lL', 'mM', 'Mm', 'Nn', 'nN', 'oO', 'Oo', 'Pp', 'pP', 'qQ', 'Qq', 'Rr',
'rR', 'sS', 'Ss', 'Tt', 'tT', 'Uu', 'uU', 'vV', 'Vv', 'Ww', 'wW', 'Xx', 'xX',
'yY', 'Yy', 'Zz', 'zZ'];

var pair;
var i;
var reactedPolymer;

function react(polymer) {
  previousPolymerLength = polymer.length;
  for(i = 0; i < polymer.length -1; i++) {
    pair = polymer.slice(i, i+2);
    if (reactiveList.indexOf(pair) >= 0) {
      polymer = polymer.replace(pair, '');
      if (i > 0) {
        i--;
      }
      if (i > 0) {
        i--;
      }
    }
  }
  return polymer;
}

reactedPolymer = react(entirePolymer);

document.writeln('Polymer after reaction: ' + reactedPolymer);
document.writeln('Polymer length: ' + reactedPolymer.length);

//Part 2
document.writeln('Part 2');

var j;
var tempRegEx;
var tempPolymer;
var minLength = 100000;
var bestUnitToRemove;

for (j = 0; j < reactiveList.length; j+=2) {
  console.log(j);
  tempRegEx = new RegExp(reactiveList[j].charAt(0), 'g');
  console.log(tempRegEx);
  tempPolymer = entirePolymer.replace(tempRegEx, '');
  tempRegEx = new RegExp(reactiveList[j].charAt(1), 'g');
  tempPolymer = tempPolymer.replace(tempRegEx, '');
  reactedPolymer = react(tempPolymer);
  if (reactedPolymer.length < minLength){
    minLength = reactedPolymer.length;
    console.log(reactiveList);
    console.log(j);
    bestUnitToRemove = reactiveList[j].charAt(1);
  }
}

document.writeln('Polymer unit to remove: ' + bestUnitToRemove);
